import React from 'react';


class Login extends React.Component{
    componentDidMount() {
        document.title = 'Login';
    }

    render() {
        const element =
            <>
                <h1>
                    this is the login page
                </h1>
                <input type="button" className="button bg-primary" value="Bootsrap" />
            </>;

        return (element);
    }
}

export default Login;
